        var loc = this.props.location;
        var labels = this.props.labels
        
        test = this.fig.canvas.append("text")

            .style("font-size", 72)

            }

            test
                .attr("x", this.x)

        };

            test.style("visibility", "hidden")
        };

            };

        });
            
       objs.on("mousemove", mousemove.bind(this)) 
           .on("mouseout", mouseout.bind(this));     
        
    }
